<center><p>
  A criação de ganso pode ser lucrativa com a venda de ovos, de matrizes para cruzamentos e melhoria de plantéis e de exemplares para ornamentação, abate ou limpeza de gramados e plantações. Há raças que são destinadas para enfeitar lagos de fazendas e hotéis, enquanto outras são indicadas para capinar ervas invasoras ou espantar bichos em lavouras. Embora o consumo ainda não seja popular por aqui, a carne saborosa e com pouca gordura da ave tem os restaurantes refinados como um destacado canal de distribuição. Bastante nutritivos, os ovos são muito apreciados em ");
            WriteLiteral(@"receitas culinárias, sendo utilizados na proporção de um para três de galinha.  
  O comércio de penas e plumas é mais uma fonte de renda que pode ser obtida com a lida do ganso. Leves, macias e de alto valor comercial, servem para preencher travesseiros, almofadas e edredons. Em bailes e desfiles de Carnaval daqui, são adornos para luxuosas fantasias e, principalmente as plumas, em países onde se pratica esportes na neve, compõem o revestimento de casacos. São retiradas da região do peito até o pescoço das aves vivas a partir dos oito meses de idade, sendo a época de muda, quando caem naturalmente uma vez por ano, a mais indicada, para evitar sofrimento aos animais.
